(11, 1, '2017-09-01 14:08:58', '2017-09-01 14:08:58', 'Considered to be one of the biggest and most ambitious film projects ever undertaken, with an overall budget of $281 million (some sources say $310-$330 million),<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Lord_of_the_Rings_(film_series)#cite_note-2\">[2]</a></sup>the entire project took eight years, with the filming for all three films done simultaneously and entirely in<a title=\"New Zealand\" href=\"https://en.wikipedia.org/wiki/New_Zealand\">New Zealand</a>, Jackson\'s native country.<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Lord_of_the_Rings_(film_series)#cite_note-3\">[3]</a></sup>Each film in the series also had special extended editions released on DVD a year after their respective theatrical releases. While the films follow the book\'s general storyline, they do omit some of the novel\'s plot elements and include some additions to and deviations from the source material.Considered to be one of the biggest and most ambitious film projects ever undertaken, with an overall budget of $281 million (some sources say $310-$330 million),<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Lord_of_the_Rings_(film_series)#cite_note-2\">[2]</a></sup>the entire project took eight years, with the filming for all three films done simultaneously and entirely in<a title=\"New Zealand\" href=\"https://en.wikipedia.org/wiki/New_Zealand\">New Zealand</a>, Jackson\'s native country.<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Lord_of_the_Rings_(film_series)#cite_note-3\">[3]</a></sup>Each film in the series also had special extended editions released on DVD a year after their respective theatrical releases. While the films follow the book\'s general storyline, they do omit some of the novel\'s plot elements and include some additions to and deviations from the source material.', 'The Lord of the Rings', '', 'publish', 'closed', 'closed', '', 'lord-of-rings', '', '', '2017-09-05 13:35:06', '2017-09-05 13:35:06', '', 0, 'http://localhost/film/?post_type=film&#038;p=11', 0, 'film', '', 0),
(12, 1, '2017-09-01 19:49:11', '2017-09-01 19:49:11', '<i>The Matrix</i>is known for popularizing a visual effect known as \"<a title=\"Bullet time\" href=\"https://en.wikipedia.org/wiki/Bullet_time\">bullet time</a>\", in which the heightened perception of certain characters is represented by allowing the action within a<a title=\"Shot (filmmaking)\" href=\"https://en.wikipedia.org/wiki/Shot_(filmmaking)\">shot</a>to progress in<a class=\"mw-redirect\" title=\"Slow-motion\" href=\"https://en.wikipedia.org/wiki/Slow-motion\">slow-motion</a>while the camera\'s viewpoint appears to move through the scene at normal speed. The film is an example of the<a title=\"Cyberpunk\" href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a><a class=\"mw-redirect\" title=\"Subgenre\" href=\"https://en.wikipedia.org/wiki/Subgenre\">subgenre</a>.<sup id=\"cite_ref-williamgibson_5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Matrix#cite_note-williamgibson-5\">[5]</a></sup>It contains numerous references to philosophical and religious ideas, and prominently pays homage to works such as<a title=\"Plato\" href=\"https://en.wikipedia.org/wiki/Plato\">Plato</a>\'s<a title=\"Allegory of the Cave\" href=\"https://en.wikipedia.org/wiki/Allegory_of_the_Cave\">Allegory of the Cave</a>,<sup id=\"cite_ref-Influence_Screened_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Matrix#cite_note-Influence_Screened-6\">[6]</a></sup><a title=\"Jean Baudrillard\" href=\"https://en.wikipedia.org/wiki/Jean_Baudrillard\">Jean Baudrillard</a>\'s<i><a title=\"Simulacra and Simulation\" href=\"https://en.wikipedia.org/wiki/Simulacra_and_Simulation\">Simulacra and Simulation</a></i><sup id=\"cite_ref-Salon_philosophy_7-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Matrix#cite_note-Salon_philosophy-7\">[7]</a></sup>and<a title=\"Lewis Carroll\" href=\"https://en.wikipedia.org/wiki/Lewis_Carroll\">Lewis Carroll</a>\'s<i><a title=\"Alice\'s Adventures in Wonderland\" href=\"https://en.wikipedia.org/wiki/Alice%27s_Adventures_in_Wonderland\">Alice\'s Adventures in Wonderland</a></i>.<sup id=\"cite_ref-Salon_review_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Matrix#cite_note-Salon_review-8\">[8]</a></sup>The Wachowskis\' approach to action scenes drew upon their admiration for<a title=\"Anime\" href=\"https://en.wikipedia.org/wiki/Anime\">Japanese animation</a><sup id=\"cite_ref-Wachowski_transcript_9-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/The_Matrix#cite_note-Wachowski_transcript-9\">[9]</a></sup>and<a title=\"Martial arts film\" href=\"https://en.wikipedia.org/wiki/Martial_arts_film\">martial arts films</a>, and the film\'s use of<a class=\"mw-redirect\" title=\"Fight choreography\" href=\"https://en.wikipedia.org/wiki/Fight_choreography\">fight choreographers</a>and<a title=\"Wire fu\" href=\"https://en.wikipedia.org/wiki/Wire_fu\">wire fu</a>techniques from<a title=\"Hong Kong action cinema\" href=\"https://en.wikipedia.org/wiki/Hong_Kong_action_cinema\">Hong Kong action cinema</a>influenced subsequent Hollywood action film productions.', 'The Matrix', '', 'publish', 'closed', 'closed', '', 'film-3', '', '', '2017-09-05 13:34:16', '2017-09-05 13:34:16', '', 0, 'http://localhost/film/?post_type=film&#038;p=12', 0, 'film', '', 0),
